//https://leetcode.com/problems/longest-substring-without-repeating-characters/
object LongestSubstring extends App {

  def lengthOfLongestSubstrin1(s: String): Int = {

    def loop(chars: Array[Char], acc: Array[Char], longest: Int): Int = {
      if (chars.isEmpty) Math.max(longest, acc.length)
      else {
        val x = chars.head
        val xs = chars.tail
        if (!acc.contains(x)) loop(xs, acc :+ x, longest)
        else
          loop(chars, Array.empty, Math.max(acc.length, longest))
      }
    }

    def loop2(s: Array[Char], acc: Array[Int]): Int = {
      if (s.isEmpty) acc.maxOption.getOrElse(0)
      else {
        val x = s.head
        val xs = s.tail
        loop2(xs,  acc :+ loop(xs, Array.empty, 0))
      }
    }

    Math.max(loop(s.toArray, Array.empty, 0), loop2(s.toArray, Array.empty))

  }

  def lengthOfLongestSubstring(s: String): Int = {
    val chars = new Array[Int](128)

    var left = 0
    var right = 0

    var res = 0
    while ( {
      right < s.length
    }) {
      val r  = s.charAt(right)
      chars(r) += 1
      while ( {
        chars(r) > 1
      }) {
        val l = s.charAt(left)
        chars(l) -= 1
        left += 1
      }
      res = Math.max(res, right - left + 1)
      right += 1
    }
    res
  }

