  println(lengthOfLongestSubstring("bbbbb")) // 1
  println(lengthOfLongestSubstring("pwwkew")) // 3
  println(lengthOfLongestSubstring("")) // 0
  println(lengthOfLongestSubstring(" ")) // 1
